import React from 'react';
import '../css/App.css';
import { useEffect } from 'react';
import userAPI from '../api/userAPI';
import Filter from '../type/Filter';


const App = () => {

  const getUsers = async () => {
    const filter: Partial<Filter> = {};

    const data = await userAPI.getUsers('');
    console.log(data);
  }

  const submitFrom = async (e: React.FormEvent<HTMLFormElement>) => {
    e.preventDefault();
    const target = e.target as typeof e.target & {
      email: { value: string };
      password: { value: string };
    };
    const formData = new FormData();
    formData.append('email', target.email.value);
    formData.append('password', target.password.value);

    // const data = await authAPI.login(formData);

    // if (data.success) {
    //     Cookie.SetCookie('accessToken', data.data.token);
    //     authStore.setUser(data.data.data);
    //     authStore.setIsLogin(true);
    //     console.log(data.data.data);
    // }
    // else {
    //     SweetAlert.AlertError("Thông báo", data.message)
    // }

  };
  useEffect(() => {
    getUsers();
  })
  return (
    <div className='d-flex container justify-content-center mt-5 flex-column'>
      <h3>Quan lý tài khoản</h3>
      <form className="w-500px mx-auto" onSubmit={submitFrom}>
        <div className="form-outline mb-4">
          <label className="form-label" >Email</label>
          <input type="email" name="search" className="form-control" />
        </div>
        <div className="form-outline mb-4">
          <label className="form-label" >Email</label>
          <select className="form-select">
            <option selected>Open this select menu</option>
            <option value="1">One</option>
            <option value="2">Two</option>
            <option value="3">Three</option>
          </select>
        </div>
        <button type="submit" className="btn btn-primary btn-block mb-4">Lọc</button>

      </form>
      <table className="table">
        <thead>
          <tr>
            <th scope="col">#</th>
            <th scope="col">Họ và tên</th>
            <th scope="col">Quyền</th>
            <th scope="col">Chức năng</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <th scope="row">1</th>
            <td>Mark</td>
            <td>Otto</td>
            <td>@mdo</td>
          </tr>
        </tbody>
      </table>
    </div>

  )
}

export default App;
